import React, { useState } from "react";
import logo from "../../assets/Images/geeker_logo.png";
import BasicButtons from "../../components/Button";
import { Container, Row, Col } from "react-bootstrap";
import Box from "@mui/material/Box";
import { Divider, Link } from "@mui/material";
import { Modal, ToggleButton, ButtonGroup } from "react-bootstrap";
import { useNavigate } from "react-router-dom";
import { Icon } from "react-icons-kit";
import { eyeOff } from "react-icons-kit/feather/eyeOff";
import { eye } from "react-icons-kit/feather/eye";

const LoginPage = () => {
  const navigate = useNavigate();
  const [show, setShow] = useState(false);
  const [radioValue, setRadioValue] = useState("customer");
  const [password, setPassword] = useState("");
  const [type, setType] = useState("password");
  const [icon, setIcon] = useState(eyeOff);
  const [userDetails, setUserDetails] = useState({
    email: "",
    password: "",
    validEmail: "",
    validPassword: "",
  });
  const [revalidation, setRevalidation] = useState({
    isEmailValid: false,
    isPasswordValid: false,
  });
  return (
    <Container>
      <div className="login-div-form my-4">
        <img src={logo} />
        <Divider className="my-4">
          <h5>Login</h5>
        </Divider>
        <div className="login-form">
          <Box
            component="form"
            sx={{
              "& .MuiTextField-root": { m: 1, width: "30ch" },
            }}
            noValidate
            autoComplete="off"
          >
            <input
              type="email"
              name="email"
              value={userDetails.email}
              placeholder="Email"
              onChange={(e) => handleChange(e)}
              // onChange={(e) =>
              //   setUserDetails({ ...userDetails, email: e.target.value })
              // }
              className="input-no-outline input-no-input-field"
            />
            <label>{userDetails.validEmail}</label>
            {console.log(userDetails)}
            {/* {userDetails && !userDetails.validEmail && <span>Enter your email</span>} */}

            <Row>
              {/* <Col> */}
              <div className="password-section">
                <input
                  type={type}
                  name="password"
                  placeholder="Password"
                  value={userDetails.password}
                  onChange={(e) => handleChange(e)}
                  // onChange={(e) =>
                  //   setUserDetails({ ...userDetails, password: e.target.value })
                  // }
                  className="input-no-outline"
                />
                <label onClick={handleToggle} style={{ cursor: "pointer" }}>
                  <Icon icon={icon} size={15} />
                </label>
              </div>
              <label>{userDetails.validPassword}</label>
              {/* </Col> */}

            </Row>
            <Col className="d-flex flex-column justify-content-center align-items-center gap-3">
              <BasicButtons
                width={"265px"}
                color={"white"}
                height={"60px"}
                borderRadius={"12px"}
                fontWeight={"700"}
                loader={false}
                background={"rgb(1, 212, 213)"}
                btnName={"Log In"}
                disabled={false}
                onClick={handleLogin}
              />
              <BasicButtons
                width={"265px"}
                color={"black"}
                height={"60px"}
                borderRadius={"12px"}
                loader={false}
                borderColor={"rgb(1, 212, 213)"}
                fontWeight={"700"}
                variant={"outlined"}
                btnName={"Continue with Google"}
                disabled={false}
              />
            </Col>
          </Box>
        </div>













        <div className="d-flex flex-wrap flex-row justify-content-center align-items-center gap-2 py-3">
          <span>Need an Account?</span>
          <Link onClick={() => setShow(true)} style={{ cursor: "pointer" }}>
            Register here
          </Link>
        </div>
        <Link
          to="/register"
          state={{ some: "value" }}
          style={{ cursor: "pointer" }}
        >
          Forgot password
        </Link>
      </div>
    </Container>
  )
}
export default LoginPage
